CREATE TABLE `credit` (
  `checking_status` varchar(255) DEFAULT NULL,
  `duration` decimal(22,9) DEFAULT NULL,
  `credit_history` varchar(255) DEFAULT NULL,
  `purpose` varchar(255) DEFAULT NULL,
  `credit_amount` decimal(22,9) DEFAULT NULL,
  `savings_status` varchar(255) DEFAULT NULL,
  `employment` varchar(255) DEFAULT NULL,
  `installment_commitment` decimal(22,9) DEFAULT NULL,
  `personal_status` varchar(255) DEFAULT NULL,
  `other_parties` varchar(255) DEFAULT NULL,
  `residence_since` decimal(22,9) DEFAULT NULL,
  `property_magnitude` varchar(255) DEFAULT NULL,
  `age` decimal(22,9) DEFAULT NULL,
  `other_payment_plans` varchar(255) DEFAULT NULL,
  `housing` varchar(255) DEFAULT NULL,
  `existing_credits` decimal(22,9) DEFAULT NULL,
  `job` varchar(255) DEFAULT NULL,
  `num_dependents` decimal(22,9) DEFAULT NULL,
  `own_telephone` varchar(255) DEFAULT NULL,
  `foreign_worker` varchar(255) DEFAULT NULL,
  `class` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

